description:
In this PDF book, I include some of the most recent posts to my network of related blogs. I hope that the resources, especially the forums, will help you increase your understanding and answer any questions you may have. There are posts in this PDF file that have information and links about progressive calf training, eating for strength, my thoughts on dietary supplements, and more. I also included an essay on flexibility, and links to useful videos. If you would like to know more about Johnston Karate, our latest news, and where our classes are held, visit the site below:
